		function getTrace({colors, counts}) {
			const xyz = colors[0].map((_, colIndex) => colors.map(row => row[colIndex]))
			const rgb = colors.map(cl => `rgb(${cl[0]}, ${cl[1]}, ${cl[2]})`)
			return	{
				x: xyz[0], y: xyz[1], z: xyz[2],
				mode: 'markers',
				showlegend: false,
				marker: {
					size: counts.map(x => x*3),
					color: rgb,
					opacity: 0.8,
					line: {
						width:0
					}
				},

			title:{

		};
